import {useEffect, useState} from 'react'
function Playlist ({userId, playlistId}) {

    const [currentPlaylist, setCurrentPlaylist] = useState()

    useEffect(()=>{
        fetch(`http://localhost:9292/users/${userId}/playlists/${currentPlaylist.id}`)
        .then(resp => resp.json())
        .then(playlist => setCurrentPlaylist(playlist))
    },[])

    return(
        <h1>Playlist</h1>
    )
}

export default Playlist
